import React, { Component } from "react";

class ListMenuUtama extends Component {
  render() {
    return (
      <div>
        <h1>
          <center>
            <img src="https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/food1.jpg" alt="Masakan Nusantara" width="600"/>
          </center>
        </h1>
      </div>
    );
  }
}
export default ListMenuUtama;
